import * as THREE from 'three';

export default function Hero(){
    return(

        // <div class="hero-main" id="hero">

        //    <div className="heading-section">
        //    <div className="intro">
        <div>
           <ReactTypingEffect
                text={["hi, i'm haniya"]}
                speed={300}
                typingDelay={1000}
                eraseDelay={1000}
                eraseSpeed={100}
                cursorRenderer={cursor => <h1 className="cursor">{cursor}</h1>}
                displayTextRenderer={(text, i) => {
                return (<p className="name">{text}</p>)}}        
      />
        <h3>"i'm a </h3>
        <ReactTypingEffect
                text={["developer", "security enthusiast", "n artist", "n explorer"]}
                speed={100}
                typingDelay={1000}
                eraseDelay={1000}
                eraseSpeed={100}
                cursorRenderer={cursor => <h1 className="cursor">{cursor}</h1>}
                displayTextRenderer={(text, i) => {
                return (<p className="name">{text}</p>)}}        
      />
           <Canvas className="box-object">
               <Box/>

               </Canvas>
         </div>
